/** Reset inputs so that the test run would behave, input wise, as if it just started. */
public synchronized void resetInputs() throws IOException {
  printDocStatistics();
  // re-initiate since properties by round may have changed.
  setConfig(config);
  source.resetInputs();
  numDocsCreated = 0;
  resetLeftovers();
}

